@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM rdf:type owl:Class .
atm:Card rdf:type owl:Class .
atm:RunningOutOfMoney rdf:type owl:Class .
atm:AcceptsCard rdf:type owl:ObjectProperty ;
    rdf:domain atm:ATM ;
    rdf:range atm:Card .

atm:RunningOutOfMoney owl:equivalentClass 
    [ rdf:type owl:Restriction ;
      owl:onProperty atm:AcceptsCard ;
      owl:allValuesFrom owl:Nothing ] .
